  const [obatList, setObatList] = useState([])

  const url='http://localhost:3001/obat/'

  axios.get(url).then( res =>{
    console.log(res)
  })

  return (
    <div className="tableList">
      <table>
        <thead>
          <tr>
            <th>No</th>
            <th>Nama</th>
            <th>Jumlah</th>
            <th>Harga</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <th></th>
            <th></th>
            <th></th>
            <th></th>
          </tr>
        </tbody>
      </table>
    </div>
  )
}

export default dataObat;
